    [],nt"revision_timestamp": "2015-09-01T18:07:56.399530",nt"name": "combined-wind-wave-hurricane-model",nt"isopen":
    true,nt"url": null,nt"notes": "The Combined Hurricane Model data is a collaboration
    between the National Renewable Energy Laboratory (NREL) and researchers at the University
    of Miami and University of Texas at Austin. The model is unique in that it offers
    time-aligned predictions of full field atmospheric data (WRF), ocean current data
    (HYCOM), and wave data (UMWM) for two major storms: Hurricane Ike, a Category 4
    storm which made landfall in Galveston, Texas in 2008, and Hurricane Sandy, a category
    3 storm with a landfall north of Atlantic City.",nt"license_title": "Creative
